class Solution:
	def threeSum(self, nums):
		"""
		:type nums: List[int]
		:rtype: List[List[int]]
		"""
		if len(nums) < 3:
			return []
		for k in range(len(nums)-1,0,-1):
			if nums.count(nums[k]) > 3:
				nums.pop(k)
		nums.sort()
		res = set()
		for i,v in enumerate(nums[:-2]):
			d = set()
			for j in nums[i+1:]:
				if j not in d:
					d.add(-(j+v))
				else:
					res.add((v,j,-(v+j)))
		return list(res)




